It is a good idea to add duration unit fields in `GroupByComponent`. But I think we should go one step further - define a `TimeDuration` class like this: 
```java
public class TimeDuration {
    private final long duration;
    private final DurationUnit unit;
}
```

The `GroupByComponent` will then contain the following fields:
```java
// [startTime, endTime)
private long startTime;
private long endTime;

// time interval
private TimeDuration interval;

// sliding step
private TimeDuration slidingStep;

// if it is left close and right open interval
private boolean leftCRightO;
```

I believe this will make the code clearer and more readable.

What do you think? @Wei-hao-Li @JackieTien97

